pragma solidity ^0.8.0;

interface ISession  {

    event SessionCreated(bytes32 indexed sessionId, 
                    address indexed owner,
                    uint256 startTime,
                    uint256 endTime,
                    uint256 rewardPerAMA,
                    uint256 rewardPool,
                    string link);

    event SessionLinkUpdated(bytes32 indexed sessionId, 
                        string link);

    event SessionTopUp(bytes32 indexed sessionId, 
                            uint256 newRewardPool, 
                            uint256 additionalFund);

    event SessionEndTimeUpdated(bytes32 indexed sessionId, 
                            uint256 newEndTime, 
                            uint256 additionalTime);

    event RewardDistributedOnAma(bytes32 indexed sessionId,
                            bytes32 indexed messageId,
                            uint256 rewardPerAMA,
                            uint256 rewardsLeft);

    event SessionEndedBeforeTime(bytes32 indexed sessionId, 
                            uint256 oldEndTime, 
                            uint256 newTime);


    event SessionRewardLeftClaimed(bytes32 indexed sessionId, 
                            uint256 rewardLeft);

    struct Session{
        address owner;
        uint256 startTime;
        uint256 endTime;
        uint256 rewardPerAMA;
        uint256 rewardPool;
        uint256 rewardLeft;
        uint256 createdTime;
        bool rewardLeftClaimed;
        string sessionLink;

    }

    struct Storage {
        bool initialized;
        string  baseURI;
        uint256  minSessionDuration;
        mapping(bytes32 => Session)  sessions;
        mapping(address => bytes32[])  addreessToSessions; ////Array of IDs all the sessions created till now
    }


    function getUserMinimumBid(address _sender, address _recipient, uint _messageType) external view returns (uint256);
    function setUserMinimumBid(uint256 minimumBidByUser, uint _messageType) external ;
    function blockUser(address address_) external;
    function unBlockUser(address address_) external;
    function whitelistUser(address address_) external;
    function unWhitelistUser(address address_) external;
    function followUser(address address_) external; 
    function unfollowUser(address address_) external; 
    function checkFollower(address sender_, address recipient_) external view returns (bool);
    function checkBlocked(address blocked_, address blocker_) external view returns (bool);
    function checkWhitelist(address whitelisted_, address whitelister_) external view returns (bool);
    function userBalance() external view  returns (uint256);
    function withdraw(uint256 _amount) external;
    function transfer(uint256 amount_,address recipient_) external;
    receive() payable external;
}
